import React, {useState, useEffect} from 'react'

import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import { Button } from '@material-ui/core';
import TextField from '@material-ui/core/TextField';
import { withStyles, makeStyles } from "@material-ui/styles";


const RegisterPopUp = (props) => {

    const [firstName, setFirstName] = useState("")
    const [lastName, setLastName] = useState("")
    const [email, setEmail] = useState("")
    const [password, setPassword] = useState("")
    const [address, setAddress] = useState("")
    const [zip, setZip] = useState("")
    const [city, setCity] = useState("")
    const [phone, setPhone] = useState("")
    const [redirect, setRedirect] = useState("")

    const InputTextWhite = withStyles({
        root: {

          '& .MuiInput-underline:before': {
            borderBottomColor: 'white',
          },
          '& .MuiInput-underline:hover:before': {
            borderBottomColor: 'white',
          },
          '& .MuiInput-underline:after': {
            borderBottomColor: 'white',
            color:"white"
          },
        },
      })(TextField);

      const useStyles = makeStyles((theme) => ({
        root: {
          display: 'flex',
          flexWrap: 'wrap',
          color: "#fff"
        },
        margin: {
          margin: theme.spacing(1),
        },
      }));

      const classes = useStyles();


    useEffect(() => {
        console.log(props.opened)
    }, [props])

    return(
        <Dialog
            open={props.opened}
            onClose={(e) => {props.onClickclose()}}
            aria-labelledby="alert-dialog-title"
            aria-describedby="alert-dialog-description"
        >
            <DialogTitle>S'enregistrer</DialogTitle>
            <DialogContent>
            <form autoComplete="off" className="register-form">
                <TextField label="Nom" color="primary" className="register-form-input"/>
                <TextField label="PrÃ©nom" color="primary" className="register-form-input"/>
                <TextField label="Email" color="primary" className="register-form-input"/>
                <TextField label="Mot de passe" color="primary" className="register-form-input"/> 
                <TextField label="Adresse" color="primary" className="register-form-input"/> 
                <TextField label="Code Postal" color="primary" className="register-form-input"/>
                <TextField label="Ville" color="primary" className="register-form-input"/>     
            </form>
            </DialogContent>
            <DialogActions>
            <Button onClick={(e) => {props.onClickclose()}} color="primary">
                Annuler
            </Button>
            <Button onClick={(e) => {props.onClickclose()}} color="primary" autoFocus>
                Envoyer
            </Button>
            </DialogActions>
        </Dialog>
    )
}

export default RegisterPopUp
